api.api.mock.script.readme:
カスタムScriptを使用して、ユーザーのRequestパラメータを取得し、Responseコンテンツを変更できます。

  **サンプルコード**
  ~~~javascript
  // 自動Mockデータを取得する
  var responseJson = {appScriptMainObject}.mockResponse.json();
  // responseJson内のページデータを変更する
  // ページをRequestパラメータのページに設定する
  responseJson.page = {appScriptMainObject}.mockRequest.getParam("page");
  // ページ合計数を120に設定する
  responseJson.total = 120;
  // 変更後のJSONを$$.mockResponseに書き込む
  {appScriptMainObject}.mockResponse.setBody(responseJson);
  ~~~
  **Request: {appScriptMainObject}.mockRequest**
  :::tip
  \$$.mockRequest オブジェクトはPostmanのpm.requestオブジェクトに同じです。 ([詳細情報](https://www.postmanlabs.com/postman-collection/Request.html))
  \$$.mockRequestとpm.requestの違いは：
  1. \$$.mockRequest.getParam(key: string)メソッドを追加した。
  2. \$$.mockRequest.cookiesを追加した。
  :::
  ~~~javascript
  // Requestのパラメータを取得
  var userId = $$.mockRequest.getParam("userId");
  // Requestのヘッダーを取得
  var userId = $$.mockRequest.headers.get("userId");
  // RequestのCookieを取得
  var userId = $$.mockRequest.cookies.get("userId");
  // RequestのBodyでのJSONデータを取得
  var requestJsonData = $$.mockRequest.body.toJSON();
  // RequestのBodyでのStringデータを取得
  var requestStringData = $$.mockRequest.body.toString();
  // RequestのBodyでのform-dataデータを取得
  var userId = $$.mockRequest.body.formdata.get("userId");
  // RequestのBodyでのurlencodedデータを取得
  var userId = $$.mockRequest.body.urlencoded.get("userId");
  ~~~
  **Response: {appScriptMainObject}.mockResponse**
  :::tip
  \$$.mockResponseオブジェクトは、Postmanのpm.responseオブジェクトと同じです。（[詳細情報](https://www.postmanlabs.com/postman-collection/Response.html)）
  \$$.mockResponseとpm.responseの違いは：
  1. \$$.mockResponse.setBody(body: any)メソッドを追加した。
  2. \$$.mockResponse.setCode(code: number)メソッドを追加した。
  3. \$$.mockResponse.setDelay(duration: number)メソッドを追加した。
  :::
  ~~~javascript
  // Responseの自動生成を取得
  var responseJsonData = $$.mockResponse.json();
  // ResponseにJSONのBodyを設定
  $$.mockResponse.setBody({setBody});
  // ResponseにStringのBodyを設定
  $$.mockResponse.setBody("Hello World!");
  // 返されたHTTPステータスコードを設定
  $$.mockResponse.setCode(200);
  // ms単位でMock Responseの遅延時間を設定
  $$.mockResponse.setDelay(3000);
  // HTTPステータスコードを取得
  var statusCode = $$.mockResponse.code;
  // HTTPヘッダーを取得
  var myHeader = $$.mockResponse.headers.get("X-My-Header");
  // KeyがX-My-HeaderのHeaderを現在のRequestから削除します。
  $$.mockResponse.headers.remove("X-My-Header")
  // KeyがX-My-HeaderのHeaderを現在のRequestに追加します
  $$.mockResponse.headers.add({addHeader});
  // KeyがX-My-HeaderのHeaderを現在のRequestにUpsertします。（Keyはすでに存在する場合は変更されます）
  $$.mockResponse.headers.upsert({addHeader})
  ~~~
  **Mock 優先度説明**
  RequestのMockデータの場合、優先順位は高度なMock期待 > カスタムMock Scriptです。
  もし高度なMock期待が一致した場合は、カスタムMock Scriptを呼び出しません。
